INSERT INTO `jobs` VALUES (68,'2024-12-25','2025-01-16','2024-12-25','Dưới 1 năm','Nhân Viên Kinh Doanh Dịch Vụ Viễn Thông - FPT Telecom Tân Bình, Tân Phú (Phỏng Vấn Đi Làm Ngay, Thu Nhập Hấp Dẫn 10 - 20 Triệu++)','10-20 triệu','Tìm kiếm, tư vấn, giải thích cho khách hàng về dịch vụ do FPT Telecom đang cung cấp.',_binary '',14,3,1,'Nam',10,'Nhân viên','Toàn thời gian'),(69,'2024-12-25','2025-01-10','2024-12-25','5 năm','Trưởng Phòng Truyền Thông - Thương Hiệu - Tại Hồ Chí Minh - Thu Nhập Hấp Dẫn','Thỏa thuận','Xây dựng và triển khai chiến lược truyền thông thương hiệu phù hợp với định hướng phát triển của Trường Đại học FPT;',_binary '',14,3,10,'Không yêu cầu',1,'Trưởng/Phó phòng','Toàn thời gian'),(70,'2024-12-25','2025-01-31','2024-12-25','Không yêu cầu kinh nghiệm','Nhân Viên Kinh Doanh Dịch Vụ Viễn Thông FPT Telecom Quận 8 (Thu Nhập Từ 8.4-25 Triệu++)','10-25 triệu','Tư vấn cho khách hàng về dịch vụ do FPT Telecom đang cung cấp (sản phẩm viễn thông: Internet, Truyền hình và Camera)',_binary '',14,3,1,'Nam',10,'Nhân viên','Toàn thời gian'),(71,'2024-12-25','2024-01-16','2024-12-25','Dưới 1 năm','Nhân Viên Kinh Doanh Dịch Vụ Viễn Thông - FPT Telecom Tân Bình, Tân Phú (Phỏng Vấn Đi Làm Ngay, Thu Nhập Hấp Dẫn 10 - 20 Triệu++)','10-20 triệu','Tìm kiếm, tư vấn, giải thích cho khách hàng về dịch vụ do FPT Telecom đang cung cấp.',_binary '',14,3,3,'Nam',10,'Nhân viên','Toàn thời gian'),(72,'2024-12-25','2025-01-22','2024-12-25','Không yêu cầu','Thực Tập Sinh Tư Vấn Tài Chính Doanh Nghiệp','Thỏa thuận','Hỗ trợ chuẩn bị và tham gia thực hiện các dự án Tư vấn Tài chính và quản trị doanh nghiệp cho các khách hàng, đối tác: các nghiệp vụ tư vấn công bố thông tin, tư vấn tổ chức Đại hội đồng cổ đông, lập Báo cáo thường niên;',_binary '',14,3,20,'Không yêu cầu',1,'Thực tập sinh','Thực tập'),(73,'2024-12-25','2025-01-24','2024-12-25','2 năm','Phó Giám Đốc Chi Nhánh','30-40 triệu','Điều hành và quản lý hoạt động của Chi nhánh, đảm bảo tuân thủ đúng quy định của Công ty và Pháp luật Nhà nước.',_binary '',14,3,6,'Nam',1,'Phó giám đốc','Toàn thời gian'),(74,'2024-12-25','2025-01-24','2024-12-25','3 năm','Kiểm Thử Phần Mềm (Tester)','20-35 triệu','Review testcase, bổ sung testcase phù hợp, hướng dẫn người dùng thực hiện test',_binary '',14,3,6,'Không yêu cầu',3,'Nhân viên','Toàn thời gian'),(80,'2024-12-25','2025-01-09','2024-12-25','Không yêu cầu','Chuyên Viên Tư Vấn Bảo Hiểm - Dự Án MB Bank - Hà Nội','Trên 20 triệu','Đảm bảo cán bộ ngân hàng hiểu rõ dịch vụ của kênh bán hàng qua ngân hàng do MB Ageas Life cung cấp và xác định được khách hàng tiềm năng để giới thiệu cho MB Ageas Life tư vấn thông qua đào tao và kèm cặp hỗ trợ',_binary '',7,5,20,'Không yêu cầu',10,'Nhân viên','Toàn thời gian'),(81,'2024-12-26','2025-01-08','2024-12-26','Dưới 1 năm','Chuyên Viên Tư Vấn Bảo Hiểm - Dự Án MB Bank - TP HCM','15-20 triệu','Đảm bảo cán bộ ngân hàng hiểu rõ dịch vụ của kênh bán hàng qua ngân hàng do MB Ageas Life cung cấp và xác định được khách hàng tiềm năng để giới thiệu cho MB Ageas Life tư vấn thông qua đào tao và kèm cặp hỗ trợ',_binary '',7,5,20,'Không yêu cầu',1,'Nhân viên','Toàn thời gian'),(83,'2024-12-26','2025-01-31','2024-12-26','1 năm','Giám Đốc Kinh Doanh','Trên 10 triệu','Thực hiện nghiên cứu thị trường; khảo sát nhu cầu khách hàng tại các hộ gia đình, khách hàng B2C trên địa bàn quản lý.',_binary '',14,7,1,'Không yêu cầu',1,'Trưởng nhóm','Toàn thời gian'),(84,'2024-12-26','2025-01-31','2024-12-26','1 năm','Nhân Viên Kinh Doanh','8-20 triệu','Tổ chức quản lý, triển khai tìm kiếm nguồn việc các công trình xây dựng, khách hàng.',_binary '',14,7,1,'Không yêu cầu',1,'Nhân viên','Toàn thời gian'),(85,'2024-12-26','2025-01-24','2024-12-26','1 năm','Unity 3D Developer','13-45 triệu','Tốt nghiệp Đại học trở lên chuyên ngành CNTT hoặc tương đương. Ưu tiên ứng viên tốt nghiệp các trường đại học Bách Khoa, ĐH Công nghệ - ĐH Quốc Gia, Học viện Bưu chính viễn thông, Học viện kỹ thuật quân sự.',_binary '',14,7,6,'Không yêu cầu',1,'Nhân viên','Toàn thời gian'),(86,'2024-12-26','2025-01-24','2024-12-26','Dưới 1 năm','Nhân Viên Lễ Tân','8-10 triệu','Lập lịch công tác tuần chi nhánh, đăng ký và xếp lịch phòng họp, làm công tác chuẩn bị cho các cuộc họp.',_binary '',14,7,3,'Không yêu cầu',1,'Nhân viên','Toàn thời gian'),(87,'2024-12-26','2025-01-24','2024-12-26','1 năm','Business Development','Thỏa thuận','Thu thập thông tin, tổng hợp, phân tích kết quả nghiên cứu xu hướng công nghệ và thị trường dịch vụ điện toán đám mây (Cloud), dịch vụ Data Center hoặc dịch vụ An toàn thông tin',_binary '',14,7,6,'Không yêu cầu',1,'Nhân viên','Toàn thời gian'),(88,'2024-12-26','2025-01-24','2024-12-26','2 năm','Kỹ Sư Thiết Kế (B2B)','8 - 15 triệu','Tiếp xúc, gặp gỡ, giới thiệu, tư vấn giải pháp hệ thống điện năng lượng mặt trời, cơ điện với khách hàng.',_binary '',14,7,17,'Nam',1,'Nhân viên','Toàn thời gian'),(89,'2024-12-26','2024-12-31','2024-12-26','Dưới 1 năm','Nhân Viên Kho Vận Logistics Làm Việc Tại Đức, Thu Nhập 70-90tr/Tháng, Yêu Cầu Bằng Đại Học, Cao Đẳng Liên Quan - Du Học Nghề Đức ','70 - 90 triệu','TopCV lựa chọn đồng hành cùng AVT Group – một trong những đối tác hàng đầu về du học nghề tại Đức, giới thiệu chương trình Du học nghề Đức & Cơ hội định cư lâu dài',_binary '',14,8,14,'Không yêu cầu',50,'Nhân viên','Toàn thời gian'),(90,'2024-12-26','2024-12-31','2024-12-26','Dưới 1 năm','Nhân Viên Kho Vận Logistics Làm Việc Tại Đức, Thu Nhập 70-90tr/Tháng, Cơ Hội Định Cư & Bảo Lãnh Gia Đình Sau 3 Năm - Du Học Nghề Đức ','70 - 90 triệu','TopCV lựa chọn đồng hành cùng AVT Group – một trong những đối tác hàng đầu về du học nghề tại Đức, giới thiệu chương trình Du học nghề Đức & Cơ hội định cư lâu dài',_binary '',14,8,14,'Không yêu cầu',50,'Nhân viên','Toàn thời gian'),(91,'2024-12-26','2024-12-31','2024-12-26','Không yêu cầu ','Điều Dưỡng Viên Làm Việc Tại Đức, Thu Nhập 75 - 110tr/Tháng, Định Cư Sau 5 Năm - Du Học Nghề Đức','75 - 110 triệu','TopCV lựa chọn đồng hành cùng AVT Group – một trong những đối tác hàng đầu về du học nghề tại Đức',_binary '',14,8,16,'Không yêu cầu',50,'Nhân viên','Toàn thời gian'),(92,'2024-12-26','2024-12-31','2024-12-26','Không yêu cầu','Nhân Viên Bán Hàng Kiêm Thu Ngân Làm Việc Tại Đức, Thu Nhập 70 - 90tr/Tháng, Định Cư Sau 5 Năm - Du Học Nghề Đức ','70 - 90 triệu','TopCV lựa chọn đồng hành cùng AVT Group – một trong những đối tác hàng đầu về du học nghề tại Đức, giới thiệu chương trình Du học nghề Đức & Cơ hội định cư lâu dài',_binary '',14,8,1,'Không yêu cầu',50,'Nhân viên','Toàn thời gian'),(93,'2024-12-26','2025-01-09','2024-12-26','2 năm','Mobile Developer (React Native) - Tại Hà Nội','Thỏa thuận','Phát triển và duy trì các ứng dụng di động sử dụng React Native, đáp ứng yêu cầu về giao diện và hiệu năng cao.',_binary '',14,8,6,'Không yêu cầu',1,'Nhân viên','Toàn thời gian'),(94,'2024-12-26','2025-01-10','2024-12-26','1 năm','Tester - Tại Hà Nội ','Thỏa thuận','Đảm bảo các tính năng phát triển sản phẩm được kiểm thử theo đúng tiêu chuẩn nghiệm thu',_binary '',14,8,6,'Không yêu cầu',1,'Nhân viên','Toàn thời gian'),(95,'2024-12-26','2025-01-24','2024-12-26','3 năm','Scrum Master','20-35 triệu','Chúng tôi đang tìm kiếm một Scrum Master giàu kinh nghiệm và am hiểu về lĩnh vực HR Tech và EdTech. Bạn sẽ đóng vai trò quan trọng trong việc thúc đẩy và duy trì quy trình Agile cho các nhóm phát triển sản phẩm',_binary '',14,10,6,'Không yêu cầu',1,'Nhân viên','Toàn thời gian'),(96,'2024-12-26','2025-01-23','2024-12-26','5 năm','Giám Đốc Đối Ngoại (Mảng Nhà Nước)','50 - 60 triệu','Mở rộng mạng lưới quan hệ với các cơ quan chính phủ tại Việt Nam, đặc biệt là các bộ phận liên quan đến quản lý thương mại điện tử, như Bộ Công Thương Việt Nam.',_binary '',14,10,4,'Không yêu cầu',1,'Giám đốc','Toàn thời gian'),(97,'2024-12-26','2025-01-02','2024-12-26','2 năm','Nhân Viên Phiên Dịch Tiếng Trung','14 - 18 triệu','Thực hiện phiên dịch tiếng Việt - tiếng Trung trong các cuộc họp của công ty, đảm bảo thông tin được truyền đạt mạch lạc và chính xác, giúp các bên hiểu rõ nội dung trao đổi.',_binary '',14,10,15,'Không yêu cầu',3,'Nhân viên','Toàn thời gian'),(98,'2024-12-26','2025-01-17','2024-12-26','1 năm','Chuyên Viên Khách Hàng Cá Nhân/Tư Vấn Tín Dụng (Lương Cơ Bản Từ 12 - 20 Triệu + Lương KPIs, Có Sẵn Định Biên/ Có Thể Đi Làm Ngay)','12 - 40 triệu','Tìm kiếm, khai thác và phát triển khách hàng cá nhân, gặp gỡ khách hàng trực tiếp để trao đổi, hoặc gọi điện thoại tư vấn, giới thiệu cho Khách hàng sản phẩm cho vay Tín chấp và Thẻ tín dụng của VPBank ',_binary '',14,6,20,'Không yêu cầu',5,'Nhân viên','Toàn thời gian'),(99,'2024-12-26','2025-01-17','2024-12-26','Không yêu cầu','Thực Tập Sinh Khách Hàng Cá Nhân (Có Sẵn Định Biên Chính Thức)','Thỏa thuận','Chăm sóc khách hàng tiềm năng và mở rộng mạng lưới khách hàng từ danh sách khách hàng hiện hữu',_binary '',14,6,20,'Không yêu cầu',10,'Thực tập sinh','Thực tập'),(100,'2024-12-26','2025-01-30','2024-12-26','Dưới 1 năm','Chuyên Viên Thu Hồi Nợ Hiện Trường - TA140','15 - 50 triệu','Thu thập thông tin về khoản nợ (bao gồm nợ tín chấp, nợ có tài sản bảo đảm nhóm nợ từ 0-90 ngày, hoặc 150 ngày trở lên...), thông tin khách hàng phục vụ cho công tác thu hồi nợ.',_binary '',14,6,20,'Không yêu cầu',5,'Nhân viên','Toàn thời gian'),(101,'2024-12-26','2025-02-28','2024-12-26','Dưới 1 năm','Tổ Trưởng Cửa Hàng Gà Rán Jollibee ','8 - 10 triệu','Thực hiện các bước sơ chế như cắt, rửa rau củ quả, rã đông',_binary '',14,12,18,'Không yêu cầu',10,'Trưởng nhóm','Toàn thời gian'),(102,'2024-12-26','2025-01-19','2024-12-26','1 năm','Chuyên Viên R&D Thực Phẩm - Đi Làm Ngay ','Thỏa thuận','Hỗ trợ cải tiến về mặt công thức, quy trình cho các các sản phẩm chính: burger, cơm, sandwich ...',_binary '',14,12,18,'Không yêu cầu',2,'Nhân viên','Toàn thời gian'),(103,'2024-12-26','2025-06-05','2024-12-26','Không yêu cầu','Nhân Viên Bảo Trì Kỹ Thuật','Thỏa thuận','Thực hiện tất cả các nhiệm vụ hỗ trợ cửa hàng về máy móc thiết bị và cơ sở vật chất.',_binary '',14,12,13,'Không yêu cầu',1,'Nhân viên','Toàn thời gian');
