INSERT INTO `services` VALUES (16,'2024-12-24','Trải nghiệm đăng tin tuyển dụng hiệu quả với vị trí nổi bật trong Việc làm tốt nhất kết hợp cùng các dịch vụ cao cấp, giá dùng thử hấp dẫn.',2887500,'TOP MAX TRIAL',7,1,'Việc làm tốt nhất'),(17,'2024-12-24','Trải nghiệm đăng tin tuyển dụng tối ưu với vị trí ưu tiên trong Việc làm hấp dẫn kết hợp cùng các dịch vụ cao cấp, giá dùng thử hấp dẫn.',2448000,'TOP PRO TRIAL',5,1,'Việc làm tốt nhất'),(18,'2024-12-24','Trải nghiệm đăng tin tuyển dụng tiết kiệm với vị trí hiển thị trong Đề xuất việc làm liên quan kết hợp cùng các dịch vụ khác, giá dùng thử hấp dẫn.',2112000,'TOP ECO PLUS TRIAL',3,1,'Việc làm tốt nhất'),(19,'2024-12-24','Đăng tin tuyển dụng hiệu quả với vị trí nổi bật trong Việc làm tốt nhất, x2 lượt đẩy Top, được sử dụng tính năng CV đề xuất kết hợp các dịch vụ cao cấp và được bảo hành với nhiều quyền lợi ưu tiên.',9650000,'TOP MAX PLUS',14,14,'Việc làm hấp dẫn, Việc làm tốt nhất'),(20,'2024-12-24','Đăng tin tuyển dụng hiệu quả với vị trí nổi bật trong Việc làm tốt nhất, được sử dụng tính năng CV đề xuất kết hợp các dịch vụ cao cấp và được bảo hành với nhiều quyền lợi ưu tiên.',7500000,'TOP MAX',14,7,'Việc làm hấp dẫn, Việc làm tốt nhất'),(21,'2024-12-24','Đăng tin tuyển dụng tối ưu với vị trí ưu tiên trong Việc làm hấp dẫn, được sử dụng tính năng CV đề xuất kết hợp các dịch vụ cao cấp và được bảo hành.',5440000,'TOP PRO',14,3,'Việc làm hấp dẫn, Việc làm tốt nhất'),(22,'2024-12-24','Đăng tin tuyển dụng tiết kiệm với vị trí hiển thị trong Đề xuất việc làm liên quan, được sử dụng tính năng CV đề xuất kết hợp các dịch vụ khác và được bảo hành.',4400000,'TOP ECO PLUS',14,1,'Việc làm hấp dẫn, Việc làm tốt nhất');
